import React, { useState } from "react";
import { Popover } from "@mui/material";
import InterestsIcon from "@mui/icons-material/Interests";

const ShapesMenu = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleShapeClick = (shape) => {
    console.log("Selected shape:", shape);
    handleClose();
  };

  return (
    <div>
    <div
      style={{
        position:"relative",
        left:"60px",
        backgroundColor: '#1976D2', 
        width: '50px',
        height: '50px',
        borderRadius: '50%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        marginTop: '5px',
        marginLeft: '2px',
        padding:'0.7px'
      }}
      onClick={handleClick}
    >
      <InterestsIcon
        sx={{
          color: 'white', 
          fontSize: 28,   
        }}
      />
    </div>
          <Popover
        open={Boolean(anchorEl)}
        anchorEl={anchorEl}
        onClose={handleClose}
        anchorOrigin={{
          vertical: "bottom",
          horizontal: "center",
        }}
        transformOrigin={{
          vertical: "top",
          horizontal: "center",
        }}
      ></Popover>
    </div>
  );
};

export default ShapesMenu;
